import { createImageList } from "../../../functions/createImageList.tsx";

var photos: string[] = [
  "./2016/IMG_3407.JPG",
  "./2016/IMG_3407.JPG",
  "./2016/IMG_3407.JPG",
  "./2016/IMG_3407.JPG",
  "./2016/IMG_3407.JPG",
];

// export default images2016;

createImageList(photos);

const newImages = [
  { id: 1, src: require("./2016/IMG_3407.JPG"), col: 2, title: "Fin" },
  { id: 2, src: require("./2016/IMG_3407.JPG"), col: 3, title: "Fin" },
  { id: 3, src: require("./2016/IMG_3407.JPG"), col: 1, title: "Fin" },
  { id: 4, src: require("./2016/IMG_3407.JPG"), col: 2, title: "Fin" },
  { id: 5, src: require("./2016/IMG_3407.JPG"), col: 3, title: "Fin" },
];
export default newImages;
